import React from 'react';

import './App.css';
import Login from './components/Login';

import SignUp from './components/SignUp';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from ""

function App() {
  return (

    <div>
      <Router>
       <Route path="/SignUp">
           <SignUp />
       </Route>

       <Route path ="/Login">

            <Login />
       </Route>
       </Router>
    </div>

  )
}

export default App;
